INSERT INTO `review` VALUES (1,2,3,5,'So excited to read','In IT STARTS WITH US, though Ryle is no longer Lilyâs husband, his manipulating, threatening and angry outbursts are all but gone.','2023-01-18 09:08:15'),(6,2,5,4,'Not just another romance','I hadnât decided, for sure, I wanted to read the sequel to IT ENDS WITH US. But when the audio recording became available at the library, I decided to give it a chance.','2023-01-16 09:08:15'),(7,3,2,2,'Decent, but not as good as the original','Lily and Ryle are divorced now, trying to make co-parenting work, without putting their daughter, Emerson, at risk of Ryleâs temper. Ryle has been pretty agreeable to Lilyâs demands so far, but he is hopeful the two of them will eventually get back together.','2023-01-16 09:08:15'),(8,4,3,3,'Colleen does it again!! (Not that I or anyone else is surprised)','As I read this book, I thought if only I had an Atlas to show me how a man should treat a woman, maybe I would have not put up with the abuse for so long. Luckily, I found my Atlas, but AFTER my divorce. I at least know I will never put up with that kind of abuse ever again.','2023-01-16 09:08:15'),(9,5,6,4,' Atlas is the star','I liked this book, but it didnât have the punch of It Ends with Us. I think it is clear that Hoover\'s storytelling, more than her writing reels you in. An interesting plot, and multi-layered characters are part of Hoover\'s strength.','2023-01-16 09:08:15'),(10,6,5,5,'Romantic ?','It Starts with Us is a very simplified version of real life. I don\'t believe things come easy in complicated relationships. Some of the more dynamic plots ended too quickly, in a less real world format.','2023-01-16 09:08:15'),(11,7,2,1,'Romantic ?','If Hoover would have dug a little deeper, showing the reader how dynamic single motherhood, the relationships we keep post divorce, and the struggle, it would have been more realistic.','2023-01-16 09:08:15'),(12,8,3,2,'Romantic ?','Overall, I loved Atlas, some of the new characters, and Lily\'s growth. This was a well done ending to a beloved story. I hope we get a show/movie soon!','2023-01-16 09:08:15'),(13,9,5,3,'Romantic ?','It Starts with Us was a beautifully written and heartwarming sequel to It Ends with Us. This was one of my most anticipated reads and it did not disappoint. Atlas and Lily deserved their happy ending and getting to read that was absolutely everything I wanted and more.','2023-01-16 09:08:15'),(14,10,6,4,'Romantic ?','Again this book picks up immediately after the ending of It Ends with Us, so I would highly recommend just reading that book first. I also suggest checking the content and trigger warnings before reading.','2023-01-16 09:08:15'),(15,11,6,5,'Romantic ?','It is dual POVs of Atlas and Lily and has a second chance romance and the found family trope.','2023-01-16 09:08:15'),(16,12,5,5,'Romantic ?','The premise of this book was definitely a lot lighter than the first book, as it focused more on accepting and fighting for love and family. The writing was amazing and just easy to read; I also loved the short chapters.','2023-01-16 09:08:15'),(17,13,3,4,'Romantic ?','The discussions regarding abuse, finding support and being a survivor was so powerful as well. While, there were some difficult and heartbreaking moments throughout the story, those moments were beautifully written and carefully handled.','2023-01-16 09:08:15'),(18,14,2,3,'Romantic ?','The romance between Atlas and Lily was incredible. I actually liked how they took their time and didnât immediately jump into a relationship. All the history, banter, chemistry and spice between them was amazing. They both deserved their happily ever after especially with everything they went through, so being able to read that was so heartwarming.','2023-01-16 09:08:15'),(19,8,5,4,'Pretty Good!','I hadnÂt decided, for sure, I wanted to read the sequel to IT ENDS WITH US. But when the audio recording became available at the library, I decided to give it a chance.\r\n','2023-01-19 11:29:32'),(20,13,5,3,'Decent, but not as good as the original','Lily and Ryle are divorced now, trying to make co-parenting work, without putting their daughter, Emerson, at risk of RyleÂs temper. Ryle has been pretty agreeable to LilyÂs demands so far, but he is hopeful the two of them will eventually get back together.\r\n','2023-01-19 11:35:04'),(21,10,5,4,'Struck the Right Tone','It\'s a great reminder that the world is filled with horrible people. But it\'s also filled with really good people. Sometimes, we need to experience the horrible people to fully appreciate the really good ones.\r\n','2023-01-19 11:44:01'),(22,11,5,4,'Love , honesty and friendship','I found this story deeply moving and although we had a bit of a wait for the final end , it was so worth it. This author certainly knows how to write a deeply emotionally charged story , that is not only tender and loving, but also some of the content is dark and fearsome. Domestic violence, child abuse and neglect are not easy topics to incorporate in a romance novel, but Colleen has managed it with understanding and compassion. ','2023-01-19 11:49:08'),(23,3,5,5,'Amazing','I canÂt put into words how much I loved this book, itÂs exactly what I needed to read after It Ends With Us.','2023-01-19 11:52:34'),(24,3,5,5,'Amazing','I canÂt put into words how much I loved this book, itÂs exactly what I needed to read after It Ends With Us.','2023-01-19 11:53:24');
